page_script({init:function(){$.fn.editable.defaults.ajaxOptions={type:"POST"},$.fn.editable.defaults.type="text",$.fn.editable.defaults.pk=1,$.fn.editable.defaults.mode="inline",$.fn.editable.defaults.inputclass="form-control",$.fn.editable.defaults.url=location.href,$.fn.editable.defaults.onblur="submit",$(".editable").editable(),$(".categories-editable").editable({mode:"popup",select2:{tags:JSON.parse($(".categories-editable").attr("data-available"))}}),$(".map-canvas").each(function(){$(this).locationpicker({location:{latitude:$(this).attr("data-latitude"),longitude:$(this).attr("data-longitude")},radius:0,zoom:13,enableAutocomplete:!0,scrollwheel:!1,onchanged:function(a){$.ajax({url:location.href,type:"POST",data:{geolocation:!0,latitude:a.latitude,longitude:a.longitude},success:function(a){try{var b=JSON.parse(a);"success"!=b.status&&console.log(a)}catch(c){console.log(a)}},error:function(a){console.log(a)}})}})}),$(".image input[type=file]").change(function(){if(0!=this.files.length){var b=$(".image form"),c=new FormData(b[0]);c.append("file","image"),$.ajax({url:location.href,type:"POST",data:c,enctype:"multipart/form-data",processData:!1,contentType:!1,success:function(a){"success"!=a&&console.log(a)},error:function(a){console.log(a)}})}})}});